INSERT INTO `dede_archives` VALUES ('2919', '11', '0', '1481156895', 'p', '1', '1', '0', '232', '0', '轻触开关电流原理', '', '', '刘杨', '未知', '/uploads/allimg/16/1-16120PR500496-lp.gif', '1481156895', '1481156760', '1', '轻触,开关,电流,原理,轻触,按键,开关,是,一种,', '0', '0', '0', '0', '0', '0', '轻触按键开关是一种自身带线路的按键，通常最上层是由PET或PC等等材料组成的有文字或图案的面板，下层是可导电的线路，中间一层是模拟开关形式并起隔离作用的由PET材料作成的双面', '', '1', '0', '0', '2893');
