INSERT INTO `dede_archives` VALUES ('2921', '11', '0', '1481329634', 'p', '1', '1', '0', '128', '0', '微动开关的广泛应用', '', '', '刘杨', '未知', '/uploads/allimg/16/1-1612100R52Q09-lp.jpg', '1481329634', '1481329573', '1', '微动,开关,的,广泛,应用,随着,科学技术,的,', '0', '0', '0', '0', '0', '0', '随着科学技术的发展，进入21世纪以来，越来越多的新型产品顺势而生。高科技产品，如电脑，手机已非常普遍，都已经进入了人民的生活。微动开关也在这种潮流下被设计生产出来。', '', '1', '0', '0', '2895');
INSERT INTO `dede_archives` VALUES ('2923', '11', '0', '1481589087', 'p', '1', '1', '0', '115', '0', '星坤电子介绍拨动开关使用时注意事项', '', '', '刘杨', '未知', '/uploads/allimg/16/1-1612130R914N8-lp.jpg', '1481589087', '1481588995', '1', '星坤,电子,介绍,拨动,开关,使,用时,注意事项,', '0', '0', '0', '0', '0', '0', '音响设备、电动玩具等电器中使用的大多数都会使用拨动开关，开关的功能主要就是通过对开关柄拨动施加不同方向的作用力来实现电路的接通还有断开，使用简单所以应用非常广泛。', '', '1', '0', '0', '2897');
INSERT INTO `dede_archives` VALUES ('2924', '11', '0', '1481601459', 'p', '1', '1', '0', '150', '0', '不要让富士康跑了', '', '', '刘杨', '未知', '/uploads/allimg/16/1-16121311341Q58-lp.png', '1481601459', '1481600456', '1', '不要,让,富士康,跑了,富士康,在,美国,建厂,', '0', '0', '0', '0', '0', '0', '富士康在美国建厂越来越不像是开玩笑。 12月7日，富士康母公司鸿海集团发布公告，正在评估美国地区潜在的投资机会，借此扩增当地营运业务。 消息是软银创始人孙正义先捅出来的。', '', '1', '0', '0', '2898');
INSERT INTO `dede_archives` VALUES ('2927', '11', '0', '1481761177', 'p', '1', '1', '0', '58', '0', '你了解微动开关吗', '', '', '刘杨', '未知', '/uploads/allimg/16/1-1612150Q5351a-lp.jpg', '1481761177', '1481760981', '1', '你,了解,微动,开关,吗,微动,开关,就是,一种,', '0', '0', '0', '0', '0', '0', '微动开关就是一种用很微小动作来执行指令的开关，它可以做成比黄豆粒还小的体积，大多用于小电流的场合，比如手机上的按键，（一种薄膜）鼠标左右键下的开关，当然微动开关还', '', '1', '0', '0', '2901');
