INSERT INTO `dede_archives` VALUES ('4080', '10', '0', '1483673931', 'p', '1', '1', '0', '172', '0', '2017年星坤电子新年祝福', '', '', '刘杨', '未知', '/uploads/allimg/17/1-1F106114130Z9-lp.jpg', '1483673931', '1483674149', '1', '2017年,星坤,电子,新年,祝福,东莞,星坤,电子,', '0', '0', '0', '0', '0', '0', '东莞星坤电子有限公司恭祝全国人民新春快乐，万事如意。 [作者：刘杨] [编辑：蔡威光] [来源：星坤企业官网]', '', '1', '0', '0', '2412');
INSERT INTO `dede_archives` VALUES ('4081', '11', '0', '1483753478', 'p', '1', '1', '0', '155', '0', '拨动开关厂家提醒您购买开关时的注意事项', '', '', '刘杨', '未知', '/uploads/allimg/17/1_010F946203458.jpg', '1483753478', '1483753580', '1', '拨动,开关,厂家,提醒,您,购买,时,的,注意事项,', '0', '0', '0', '0', '0', '0', '随着科学技术的发展，很多高科技产品的出现，大大解放了人类的双手，让人们可以通过机器，完成自己想要的工作。拨动开关在当前的家用电器中，使用率很高，很多复杂的工序都是', '', '1', '0', '0', '2413');
INSERT INTO `dede_archives` VALUES ('4082', '11', '0', '1483786720', 'p', '1', '1', '0', '122', '0', 'XKB星坤推出iphone7耳机插口，乐视四级音频转接母', 'iphone7耳机插口', '', '刘扬', '未知', '/uploads/allimg/17/4-1F10GU143414-lp.jpg', '1483786720', '1483786423', '4', 'iphone7耳机插口，iphone7耳机转接头，乐视耳机转', '0', '0', '0', '0', '0', '0', 'XKB星坤推出iphone7耳机插口，乐视四级音频转接母座头', '', '4', '0', '0', '2414');
INSERT INTO `dede_archives` VALUES ('4083', '11', '0', '1484043689', 'p', '1', '1', '0', '165', '0', '带灯轻触开关的使用', '', '', '刘杨', '未知', '/uploads/allimg/17/1_01101R60G536.jpg', '1484043689', '1484043967', '1', '带灯,轻触,开关,的,使用,以前市,面上,大多数,', '0', '0', '0', '0', '0', '0', '以前市面上大多数的开关都属于薄膜开关，但是由于薄膜开关的结构单一，生产过程也比较简单，所以有很多的缺陷。慢慢的，轻触开关开始盛行，尤其是带灯轻触开关，带灯轻触开关', '', '1', '0', '0', '2415');
INSERT INTO `dede_archives` VALUES ('4084', '11', '0', '1484132771', 'p', '1', '1', '-2', '61', '0', '2.5音频耳机插座产生电源噪声的原因', '', '', '刘杨', '未知', '/uploads/allimg/170111/1ZUH030-0-lp.jpg', '1484132771', '1484132937', '1', '2.5,音频,耳机,插座,产生,电源,噪声,的,原因,', '0', '0', '0', '0', '0', '0', '2.5/3.5音频耳机插座厂家分析插座产生电源噪声的原因 2.5/3.5音频耳机插座产生电源噪声的原因，具体内容如下： 原因一、由于外界因素影响而产生的干扰 2.5/3.5耳机插座厂家介绍，外界', '', '1', '0', '0', '2416');
INSERT INTO `dede_archives` VALUES ('4085', '11', '0', '1484216829', 'p', '1', '1', '0', '133', '0', '轻触开关最新的环保RoHS有害物质限值', '', '', '刘杨', '未知', '/uploads/allimg/17/1_01121S315a46.jpg', '1484216829', '1484217195', '1', '轻触,开关,最,新的,环保,RoHS,有害物质,限值,', '0', '0', '0', '0', '0', '0', '轻触开关最新的RoHS有害物质限值 一、六价铬的法规要求： 1. 欧盟： 76/769/EEC：禁止使用; 94/62/EC：100ppm; ROHS：1000ppm 。 1999/179/EEC，2002/EEC：10ppm 2. ROHS 豁免项： 碳钢中的防腐剂，电冰箱', '', '1', '0', '0', '2417');
INSERT INTO `dede_archives` VALUES ('4086', '11', '0', '1484302911', 'p', '1', '1', '0', '203', '0', '插座开关的工作原理和优势', '', '', '刘杨', '未知', '/uploads/allimg/17/1_01131R4261N1.jpg', '1484302911', '1484303066', '1', '插座,开关,的,工作,原理,和,优势,插座,有,', '0', '0', '0', '0', '0', '0', '插座有单键式和多键组合式两种类型。单键式插座开关一般用于电视机中作电源插座，它又分为自锁自复位式（这种开关按一下即接通自锁，再按一下则断开复位）和无锁式（不能锁定', '', '1', '0', '0', '2418');
INSERT INTO `dede_archives` VALUES ('4087', '11', '0', '1484562809', 'p', '1', '1', '0', '146', '0', '3.5耳机插座的电源电阻值分析', '', '', '刘杨', '未知', '/uploads/allimg/17/1_01161S6162235.jpg', '1484562809', '1484562976', '1', '3.5,耳机,插座,的,电源,电,阻值,分析,接触,', '0', '0', '0', '0', '0', '0', '接触电阻 Measured at small current(100 ma or less)1000Hz,3.5耳机插座在微小电流（100mA）以下测试. 50m MAX.50m以下. 由于温度传感器具有电阻值，当电流流过温度传感器元件时，会有功率损耗，就会', '', '1', '0', '0', '2419');
INSERT INTO `dede_archives` VALUES ('4088', '11', '0', '1484649564', 'p', '1', '1', '0', '148', '0', '如何判断开关的好坏', '', '', '刘杨', '未知', '/uploads/allimg/17/1_011GS9156101.jpg', '1484649564', '1484649555', '1', '如何,判断,开关,的,好坏,现在,来,介绍,如何,', '0', '0', '0', '0', '0', '0', '现在来介绍如何辨认品质，我们从外到里看： 1、外观都分为外边框、内边框、功能件，好的开关的内、外边框都是PC料的，PC料学名聚碳酸酯，俗称防弹胶，具有阻燃、抗扭曲、抗冲击', '', '1', '0', '0', '2420');
INSERT INTO `dede_archives` VALUES ('4089', '11', '0', '1484726419', 'p', '1', '1', '0', '63', '0', '如何提高轻触开关的使用功率', '', '', 'xkdz', '未知', '/uploads/allimg/17/5_011Q6121b428.jpg', '1484726419', '1484727139', '5', '如何,提高,轻触,开关,的,使用,功率,轻触,开关,', '0', '0', '0', '0', '0', '0', '轻触开关正在走向大众化，微型化，提高轻触开关的使用功率，使之小型化、轻量化，开关,接插件的额定电压,电流要留有一定的余量，轻触开关是通过推动开关柄使电路接通或断开，', '', '5', '0', '0', '2421');
INSERT INTO `dede_archives` VALUES ('4090', '11', '0', '1484899287', 'p', '1', '1', '0', '70', '0', '轻触开关三种材质材料', '', '', '刘杨', '未知', '/uploads/allimg/17/1_012016024bC5.jpg', '1484899287', '1484899369', '1', '轻触,开关,三种,材质,材料,轻触,开关,有三种,', '0', '0', '0', '0', '0', '0', '轻触开关有三种材质：铜弹片此款材料偏软，用在轻触开关上面寿命较低，正常只有3-5W次寿命是市面上面最多厂家选择使用的，质量稳定价格适中不锈钢弹片此款材料需要不锈钢镀银，', '', '1', '0', '0', '2422');
