INSERT INTO `dede_archives` VALUES ('4200', '11', '0', '1487383494', 'p', '1', '1', '0', '119', '0', '拨动开关的种类', '', '', '刘杨', '未知', '/uploads/allimg/17/1-1F21Q0064a44-lp.jpg', '1487383494', '1487383634', '1', '拨动,开关,的,种类,拨动,开关,又名,滑动,英,', '0', '0', '0', '0', '0', '0', '拨动开关又名滑动开关，英文名slide switch 拨动开关的品种有单极双位、单极三位、双极双位以及双极三位等，它一般用于低压电路。 此款开关的种类有分为： 1，横柄拨动开关 2，直柄', '', '1', '0', '0', '2532');
