INSERT INTO `dede_archives` VALUES ('4202', '11', '0', '1487831118', 'p', '1', '1', '0', '206', '0', '拨动开关的接通原理', '', '', '刘杨', '未知', '/uploads/allimg/17/1-1F223142629212-lp.jpg', '1487831118', '1487831221', '1', '拨动,开关,的,接通,原理,拨动,开关,的,接通,', '0', '0', '0', '0', '0', '0', '拨动开关的接通原理分析： 拨动开关是通过拨动开关柄来带动滑块或滑片的滑动，从而控制开关触的接通与断开。 拨动开关分为单极双位和双极双位两种结构形式，主要用于电源电路的', '', '1', '0', '0', '2534');
INSERT INTO `dede_archives` VALUES ('4203', '11', '0', '1487930353', 'p', '1', '1', '0', '198', '0', '如何挑选轻触开关及其寿命测试方法', '', '', '刘杨', '未知', '/uploads/allimg/17/1_02241P0404053.jpg', '1487930353', '1487930440', '1', '如何,挑选,轻触,开关,及其,寿命,测试,方法,', '0', '0', '0', '0', '0', '0', '轻触开关的挑选 识别轻触开关的好坏，关键在于考究轻触开关的防护性、可焊性、导通可靠性、寿命、手感、生产工艺和安装尺寸等方面因素决定 。以下品赞电子就如何挑选轻触开关', '', '1', '0', '0', '2535');
