INSERT INTO `dede_archives` VALUES ('4238', '11', '0', '1491544095', 'p', '1', '1', '0', '141', '0', '10分钟能充50%七大快速充电技术盘点', '', '', '', '未知', '/uploads/allimg/17/4-1F40G34524M4-lp.png', '1491544095', '1491544068', '4', '10分钟,能充,50%,七大,快速,充电,技术,盘点,', '0', '0', '0', '0', '0', '0', '手机硬件正在以超摩尔定律的速度前进着，早先的单核双核已经进化到了如今的八核十核，进步十分明显。本以为如此趋势下去手机赶超PC也只是时间问题，却没想到电池技术成为了阻碍', '', '4', '0', '0', '2477');
