INSERT INTO `dede_archives` VALUES ('4241', '11', '0', '1491869432', 'p', '1', '1', '0', '165', '0', '怎么检查防水轻触开关', '', '', '刘杨', '未知', '/uploads/allimg/17/4-1F4110Q113Y1-lp.jpg', '1491869432', '1491869485', '4', '怎么,检查,防水,轻触,开关,防水,轻触,开关,是,', '0', '0', '0', '0', '0', '0', '防水轻触开关是轻触开关的一种，它能在水中或许有水浸洗也不会失灵的开关，通常防水开关的等级为IP67级，也就是说防水轻触开关可以对空中的尘埃起到彻底防护的功能。那防水轻触', '', '4', '0', '0', '2480');
INSERT INTO `dede_archives` VALUES ('4242', '11', '0', '1491964284', 'p', '1', '1', '0', '179', '0', '防水微动开关在共享单车智能扫码锁中的应用', '', '', '星坤电子', '未知', '/uploads/allimg/17/4-1F4121022522S-lp.jpg', '1491964284', '1491963845', '4', '防水,微动,开,关在,共享,单车,智能,扫码,锁,', '0', '0', '0', '0', '0', '0', '生活中，大街小巷随处可见各色的共享单车，与公交车、地铁站等交通枢纽接驳。但是，共享单车带给市民更多出行便捷的同时，也存在着软件计费混乱、共享单车成专车以及单车损毁', '', '4', '0', '0', '2481');
