INSERT INTO `dede_arctype` VALUES ('1', '0', '0', '1', '关于星坤', '{cmspath}/stark', '1', 'index.html', '1', '1', '-1', '1', '0', 'default/xkjj.htm', 'default/xkjj.htm', 'default/xkjj.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '关于星坤|香港星坤工业精密有限公司', '关于星坤|香港星坤工业精密有限公司', '关于星坤|香港星坤工业精密有限公司', '0', '{cmspath}/stark', '', '0', '0', '', '<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:16px;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">东莞市星坤电子有限公司成立于1995年，是一家现代化的高科技企业，集产品研发、生产、销售、于一体。总部星坤企业设在台湾，并根据战略部署先后在香港、东莞、厦门等建立分公司，目前公司占地总面积12000㎡，厂房面积18000㎡，员工人数超过上千名，专业工程技术人员达到百余名。作为以技术制胜的现代化电子零组件企业，星坤拥有自主知识产权，公司拥有多项领先国际同行的自主知识产权，是电子零组件解决方案供应商</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 精益求精，品质制胜，星坤企业始终在发展中坚持精益求精的精神。在产品设计中，多方面创造和运用先进的技术，具备了高超的多塑模、五金模设计能力，并实现了高速多线冲模。独立开发适用于现代全自动生产需要的产品，从细节入手，强调品质的保障，追求精益求精的精神。</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 人性化设计，匹配差异化。星坤企业不仅仅拥有着庞大的生产能力和规模，而且还具有着极为完善的产品流水线，能够为当前市场的差异化需求提供人性化的设计。在当前不同领域之中，对电子零部件上的苛刻要求，丰富电子零部件是企业扩大经营和实现跨越式发展的必然，从而更好的传递出企业强大的市场优势。</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 星坤主营业务主要包括开关、插座、连接器. 具体经营产品涉及&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">轻触开关，<a href=\"http://www.xk-dg.cn/List.aspx?parentID=616\" style=\"text-decoration: none; font-size: 12px; color: rgb(0, 0, 0); outline: none;\" target=\"_blank\">按键开关</a>，拨动开关，微动开关，船型开关，震动开关，<a href=\"http://www.xk-dg.cn/List.aspx?parentID=616\" style=\"text-decoration: none; font-size: 12px; color: rgb(0, 0, 0); outline: none;\" target=\"_blank\">耳机插座</a>,DC电源插座，USB连接器，条形连接器&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">等。随着世界工业水平的提升，各国家和地区对于电子零部件的需求量不断的攀升,星坤电子作为电子零部件供应商，始终以高品质的产品输出为世界工业的发展奠定基石&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp;</span><span style=\"color: rgb(0, 0, 255);\"><span style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px;\"><strong>&nbsp; &nbsp;打造全球零组件解决方案提供商，这是星坤企业一直发展的目标 。</strong></span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<strong><span style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 公司制定&ldquo;不重复错误，追求产品零缺陷，直至客户满意&rdquo;的品质方针 。</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 在合作上实现与客户之间的诚信有礼、互利互惠。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 东莞市星坤电子有限公司坚信&ldquo;人品即品质&rdquo;，用事实征服大众市场。</span></strong></span></span>', '');
INSERT INTO `dede_arctype` VALUES ('2', '1', '1', '2', '星坤简介', '{cmspath}/stark', '1', 'index.html', '1', '1', '-1', '2', '0', '{style}/index_article.htm', '{style}/list_article.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '星坤企业自1995年投资以来，广泛涉足数位内容,手机、MP3、MP4、数位相机、鼠标、键盘、汽车部品、数码音响、家用电器、办公设备、测量仪器、工业控制设备、汽车零组件、云运算，从事的产品有开关，插座，连接器，外设产品。', '星坤，东莞星坤，星坤电子，星坤XKB', '星坤简介|关于星坤|香港星坤工业精密有限公司', '0', '{cmspath}/stark', '', '0', '0', '', '&nbsp;', '');
INSERT INTO `dede_arctype` VALUES ('3', '0', '0', '2', '新闻资讯', '{cmspath}/stark/new', '1', 'index.html', '1', '1', '-1', '0', '0', '{style}/index_article.htm', '{style}/list_article.htm', '{style}/article_article.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '新闻资讯|香港星坤工业精密有限公司', '新闻资讯|香港星坤工业精密有限公司', '新闻资讯|香港星坤工业精密有限公司', '0', '{cmspath}/stark/new', '', '0', '0', '', '&nbsp;', '');
INSERT INTO `dede_arctype` VALUES ('4', '0', '0', '3', '产品中心', '{cmspath}/stark/cp', '1', 'index.html', '1', '6', '-1', '1', '0', '{style}/list_shop1.htm', '{style}/list_shop1.htm', '{style}/article_shop.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '产品中心|東莞市星坤電子有限公司', '产品中心|東莞市星坤電子有限公司', '产品中心|東莞市星坤電子有限公司', '0', '{cmspath}/stark/cp', '', '0', '0', '', '&nbsp;', '');
INSERT INTO `dede_arctype` VALUES ('5', '0', '0', '5', '核心竞争力', '{cmspath}/stark/js', '1', 'index.html', '1', '1', '-1', '1', '0', 'default/scjs.htm', 'default/scjs.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '核心竞争力|香港星坤工业精密有限公司', '核心竞争力|香港星坤工业精密有限公司', '核心竞争力|香港星坤工业精密有限公司', '0', '{cmspath}/stark/js', '', '0', '0', '', '<span style=\"font-family: 微软雅黑; font-size: 14px; line-height: 28px; color: rgb(255, 255, 255);\"><font size=\"4\"><span style=\"line-height: 30px;\"><b><span style=\"background-color: rgb(105, 105, 105);\">冲压注塑加工</span></b></span></font></span>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px; margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n	星坤采用进口的高速精密冲床,确保了五金零件的高速稳定生产和零件的精度。<br />\r\n	星坤全部采用欧洲和日本产的全自动闭环控制的精密注塑机来生产塑胶零件，以保证塑胶零件的精度。注塑机吨位从20T到150T不等,种类包括卧式和立式两种。<br />\r\n	<strong><img alt=\"\" src=\"/uploads/allimg/160506/2-1605062322191b.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /></strong><img alt=\"\" src=\"/uploads/allimg/160506/2-160506232231145.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /><strong><img alt=\"\" src=\"/uploads/allimg/160506/2-1605062322411U.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /></strong></div>\r\n<hr style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(72, 72, 72); font-size: 14px;\" />\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px; margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n	<span style=\"color: rgb(255, 255, 255);\"><span style=\"font-size: large;\"><strong><span style=\"background-color: rgb(105, 105, 105);\">电镀加工</span></strong></span></span><br />\r\n	严谨和有序的现场管理,准确及时的检测和分析,确保了我们五金零件的电镀质量。<br />\r\n	<img alt=\"\" src=\"/uploads/allimg/160506/2-1605062331415X.jpg\" style=\"border: 0px; font-size: 12px; color: rgb(0, 0, 255); margin: 0px; padding: 0px; width: 220px; height: 171px;\" />&nbsp;<img alt=\"\" src=\"/uploads/allimg/160506/2-160506233153436.jpg\" style=\"border: 0px; color: rgb(0, 0, 255); font-size: 12px; margin: 0px; padding: 0px; width: 220px; height: 171px;\" />&nbsp;<span style=\"color: rgb(0, 0, 255); font-size: 12px;\">&nbsp;</span><img alt=\"\" src=\"/uploads/allimg/160506/2-16050623320T43.jpg\" style=\"border: 0px; color: rgb(0, 0, 255); font-size: 12px; margin: 0px; padding: 0px; width: 220px; height: 171px;\" />&nbsp;<span style=\"font-size: 12px; color: rgb(0, 0, 255);\">&nbsp;</span></div>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px; margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n	<div style=\"margin: 0px; padding: 0px;\">\r\n		<div style=\"margin: 0px; padding: 0px;\">\r\n			<hr />\r\n			<div style=\"margin: 0px; padding: 0px;\">\r\n				<span style=\"font-size: large; color: rgb(255, 255, 255); background-color: rgb(105, 105, 105);\">&nbsp;</span><strong style=\"font-size: large; color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(105, 105, 105);\">装配加工</span></strong></div>\r\n		</div>\r\n	</div>\r\n	星坤拥有自己强大的自动化/半自动化装配和测试设备的设计制造部门，大大提高了产线的效率和产品质量的稳定性。<br />\r\n	<img alt=\"\" src=\"/uploads/allimg/160506/2-160506232424917.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /><img alt=\"\" src=\"/uploads/allimg/160506/2-160506232450535.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /><img alt=\"\" src=\"/uploads/allimg/160506/2-160506232500295.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /></div>\r\n<hr style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(72, 72, 72); font-size: 14px;\" />\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px; margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n	<span style=\"color: rgb(255, 255, 255);\"><span style=\"font-size: large;\"><strong><span style=\"background-color: rgb(105, 105, 105);\">模具加工</span></strong></span></span><br />\r\n	星坤拥有一支专业的五金、塑胶模具设计和制造队伍，拥有欧美和日本产的CNC、WireCut、EDM等各种精密模具加工设备，所加工的模具质量可以达到国际先进水准。 &nbsp; &nbsp;<br />\r\n	<img alt=\"\" src=\"/uploads/allimg/160430/2-160430120FVG.jpg\" style=\"width: 670px; height: 446px;\" /><img alt=\"\" src=\"/uploads/allimg/160430/2-160430120K9302.jpg\" style=\"width: 670px; height: 446px;\" /></div>\r\n<div>\r\n	&nbsp;</div>\r\n', '');
INSERT INTO `dede_arctype` VALUES ('7', '0', '0', '4', '应用领域', '{cmspath}/stark/ly', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/list_hezuo11.htm', 'default/list_hezuo11.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '应用领域|香港星坤工业精密有限公司', '应用领域|香港星坤工业精密有限公司', '应用领域|香港星坤工业精密有限公司', '0', '{cmspath}/stark/ly', '', '0', '0', '', '&nbsp;', '');
