INSERT INTO `dede_arctype` VALUES ('35', '5', '5', '12', '危害物质管理', '{cmspath}/stark/whwzgl', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/about.htm', 'default/about.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '危害物质管理|香港星坤工业精密有限公司', '危害物质管理|香港星坤工业精密有限公司', '危害物质管理|香港星坤工业精密有限公司', '0', '{cmspath}/stark/js', '', '0', '0', '', '&nbsp;&nbsp;\r\n<div class=\"main-txt\" style=\"margin: 10px 0px 30px; padding: 20px; word-wrap: break-word; list-style-type: none; line-height: 1.5; border: 1px dashed rgb(229, 229, 229); clear: both; color: rgb(117, 117, 117); font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif;\">\r\n	<h3 style=\"margin: 0px; padding: 10px 0px; word-wrap: break-word; list-style-type: none; font-size: 18px; border-bottom-color: rgb(229, 229, 229); border-bottom-style: solid; border-bottom-width: 2px;\">\r\n		绿色环保 星坤公司的产品符合 RoHS</h3>\r\n	<div style=\"margin: 0px; padding: 0px; word-wrap: break-word; list-style-type: none; font-size: 18px; line-height: 24px;\">\r\n		1、重金属： Heavy metal&nbsp;<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		2、铅及其化合物( Lead and its Compounds )&nbsp;<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		3、镉及其化合物( Cadmium and its Compounds )&nbsp;<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		4、汞及其化合物 ( Mercury and its Compounds )&nbsp;<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		5、六价铬化合物(Chromium VI Compounds)<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		6、有机溴化物： Organic Bromide<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		7、多溴联苯（ PBB ）<br style=\"margin: 0px; padding: 0px; word-wrap: break-word;\" />\r\n		8、多溴二苯醚（ PBDE</div>\r\n</div>\r\n<h3 style=\"margin: 0px; padding: 10px 0px; word-wrap: break-word; font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; list-style-type: none; font-size: 18px; color: rgb(117, 117, 117); line-height: 24px;\">\r\n	一、星坤公司认可的检测机构：XKB ratify test dept，SGS、UL、CTI、ITS。</h3>\r\n<p style=\"margin: 0px; padding: 0px; word-wrap: break-word; list-style-type: none; color: rgb(117, 117, 117); font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; font-size: 14.4px; line-height: 24px;\">\r\n	环境管理物质测试方法、测试仪器、和标准含量：RoHS manage material testmethod、test equipment &amp; criterion contain<img alt=\"帝克公司认可的检测机构\" data-bd-imgshare-binded=\"1\" src=\"http://www.dicgu.net/uploadfiles/image/dicgu/RoHS1.jpg\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; height: 362px; width: 730px;\" /></p>\r\n<h3 style=\"margin: 0px; padding: 10px 0px; word-wrap: break-word; font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; list-style-type: none; font-size: 18px; color: rgb(117, 117, 117); line-height: 24px;\">\r\n	二、环保体系的管控：RoHS System Control</h3>\r\n<p style=\"margin: 0px; padding: 0px; word-wrap: break-word; list-style-type: none; color: rgb(117, 117, 117); font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; font-size: 14.4px; line-height: 24px;\">\r\n	<img alt=\"环保体系的管控\" data-bd-imgshare-binded=\"1\" src=\"http://www.dicgu.net/uploadfiles/image/dicgu/RoHS2.jpg\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; height: 759px; width: 730px;\" /></p>\r\n<h3 style=\"margin: 0px; padding: 10px 0px; word-wrap: break-word; font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; list-style-type: none; font-size: 18px; color: rgb(117, 117, 117); line-height: 24px;\">\r\n	三、绿色环保 RoHS</h3>\r\n<p style=\"margin: 0px; padding: 0px; word-wrap: break-word; list-style-type: none; color: rgb(117, 117, 117); font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; font-size: 14.4px; line-height: 24px;\">\r\n	<img alt=\"绿色环保 RoHS\" data-bd-imgshare-binded=\"1\" src=\"http://www.dicgu.net/uploadfiles/image/dicgu/RoHS3.jpg\" style=\"margin: 0px; padding: 0px; word-wrap: break-word; height: 430px; width: 730px;\" /></p>\r\n', '');
