INSERT INTO `dede_arctype` VALUES ('34', '5', '5', '1', '生产介绍', '{cmspath}/stark/js', '1', 'index.html', '1', '1', '-1', '2', '0', 'default/about.htm', 'default/about.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '生产介绍|香港星坤工业精密有限公司', '生产介绍|香港星坤工业精密有限公司', '生产介绍|香港星坤工业精密有限公司', '0', '{cmspath}/stark/js', '', '0', '0', '', '<div style=\"font-family: Arial, Helvetica, sans-serif; line-height: 30px;\">\r\n	<span style=\"font-family: 微软雅黑; font-size: 14px; line-height: 28px; color: rgb(255, 255, 255);\"><font face=\"Arial, Helvetica, sans-serif\" size=\"4\"><span style=\"line-height: 30px;\"><b><span style=\"background-color: rgb(105, 105, 105);\">冲压注塑加工</span></b></span></font></span>\r\n	<div style=\"margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n		星坤采用进口的高速精密冲床,确保了五金零件的高速稳定生产和零件的精度。<br />\r\n		星坤全部采用欧洲和日本产的全自动闭环控制的精密注塑机来生产塑胶零件，以保证塑胶零件的精度。注塑机吨位从20T到150T不等,种类包括卧式和立式两种。<br />\r\n		<strong><img alt=\"\" src=\"/uploads/allimg/160506/2-1605062322191b.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /></strong><img alt=\"\" src=\"/uploads/allimg/160506/2-160506232231145.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /><strong><img alt=\"\" src=\"/uploads/allimg/160506/2-1605062322411U.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /></strong></div>\r\n	<hr style=\"color: rgb(72, 72, 72); font-size: 14px;\" />\r\n	<div style=\"margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n		<span style=\"color: rgb(255, 255, 255);\"><span style=\"font-size: large;\"><strong><span style=\"background-color: rgb(105, 105, 105);\">电镀加工</span></strong></span></span><br />\r\n		严谨和有序的现场管理,准确及时的检测和分析,确保了我们五金零件的电镀质量。<br />\r\n		<img alt=\"\" src=\"/uploads/allimg/160506/2-1605062331415X.jpg\" style=\"border: 0px; font-size: 12px; color: rgb(0, 0, 255); margin: 0px; padding: 0px; width: 220px; height: 171px;\" />&nbsp;<img alt=\"\" src=\"/uploads/allimg/160506/2-160506233153436.jpg\" style=\"border: 0px; color: rgb(0, 0, 255); font-size: 12px; margin: 0px; padding: 0px; width: 220px; height: 171px;\" />&nbsp;<span style=\"color: rgb(0, 0, 255); font-size: 12px;\">&nbsp;</span><img alt=\"\" src=\"/uploads/allimg/160506/2-16050623320T43.jpg\" style=\"border: 0px; color: rgb(0, 0, 255); font-size: 12px; margin: 0px; padding: 0px; width: 220px; height: 171px;\" />&nbsp;<span style=\"font-size: 12px; color: rgb(0, 0, 255);\">&nbsp;</span></div>\r\n	<div style=\"margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n		<div style=\"margin: 0px; padding: 0px;\">\r\n			<div style=\"margin: 0px; padding: 0px;\">\r\n				<hr />\r\n				<div style=\"margin: 0px; padding: 0px;\">\r\n					<span style=\"font-size: large; color: rgb(255, 255, 255); background-color: rgb(105, 105, 105);\">&nbsp;</span><strong style=\"font-size: large; color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(105, 105, 105);\">装配加工</span></strong></div>\r\n			</div>\r\n		</div>\r\n		星坤拥有自己强大的自动化/半自动化装配和测试设备的设计制造部门，大大提高了产线的效率和产品质量的稳定性。<br />\r\n		<img alt=\"\" src=\"/uploads/allimg/160506/2-160506232424917.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /><img alt=\"\" src=\"/uploads/allimg/160506/2-160506232450535.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /><img alt=\"\" src=\"/uploads/allimg/160506/2-160506232500295.jpg\" style=\"border: 0px; margin: 0px; padding: 0px; width: 220px; height: 198px;\" /></div>\r\n	<hr style=\"color: rgb(72, 72, 72); font-size: 14px;\" />\r\n	<div style=\"margin: 0px; padding: 0px; color: rgb(72, 72, 72); font-size: 14px;\">\r\n		<span style=\"color: rgb(255, 255, 255);\"><span style=\"font-size: large;\"><strong><span style=\"background-color: rgb(105, 105, 105);\">模具加工</span></strong></span></span><br />\r\n		星坤拥有一支专业的五金、塑胶模具设计和制造队伍，拥有欧美和日本产的CNC、WireCut、EDM等各种精密模具加工设备，所加工的模具质量可以达到国际先进水准。 &nbsp; &nbsp;<br />\r\n		<img alt=\"\" src=\"/uploads/allimg/160430/2-160430120FVG.jpg\" style=\"width: 670px; height: 446px;\" /><img alt=\"\" src=\"/uploads/allimg/160430/2-160430120K9302.jpg\" style=\"width: 670px; height: 446px;\" /></div>\r\n</div>\r\n<br />\r\n', '');
