INSERT INTO `dede_arctype` VALUES ('42', '8', '8', '6', '导航地图', '{cmspath}/stark/dhdt', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/dhdt.htm', 'default/dhdt.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '导航地图|联系我们|东莞市星坤电子有限公司', '导航地图|联系我们|东莞市星坤电子有限公司', '导航地图|联系我们|东莞市星坤电子有限公司', '0', '{cmspath}/stark/lx', '', '0', '0', '', '<meta content=\"text/html; charset=gb2312\" http-equiv=\"Content-Type\" />\r\n<meta content=\"百度地图,百度地图API，百度地图自定义工具，百度地图所见即所得工具\" name=\"keywords\" />\r\n<meta content=\"百度地图API自定义地图，帮助用户在可视化操作下生成百度地图\" name=\"description\" />\r\n<!--引用百度地图API-->\r\n<style type=\"text/css\">\r\nhtml,body{margin:0;padding:0;}\r\n    .iw_poi_title {color:#CC5522;font-size:14px;font-weight:bold;overflow:hidden;padding-right:13px;white-space:nowrap}\r\n    .iw_poi_content {font:12px arial,sans-serif;overflow:visible;padding-top:4px;white-space:-moz-pre-wrap;word-wrap:break-word}</style>\r\n<script type=\"text/javascript\" src=\"http://api.map.baidu.com/api?key=&v=1.1&services=true\"></script><!--百度地图容器-->\r\n<div id=\"dituContent\" style=\"border-bottom: #ccc 1px solid; border-left: #ccc 1px solid; width: 697px; height: 550px; border-top: #ccc 1px solid; border-right: #ccc 1px solid\">\r\n	&nbsp;</div>\r\n<script type=\"text/javascript\">\r\n    //创建和初始化地图函数：\r\n    function initMap(){\r\n        createMap();//创建地图\r\n        setMapEvent();//设置地图事件\r\n        addMapControl();//向地图添加控件\r\n        addMarker();//向地图中添加marker\r\n    }\r\n    \r\n    //创建地图函数：\r\n    function createMap(){\r\n        var map = new BMap.Map(\"dituContent\");//在百度地图容器中创建一个地图\r\n        var point = new BMap.Point(114.101983,22.826627);//定义一个中心点坐标\r\n        map.centerAndZoom(point,17);//设定地图的中心点和坐标并将地图显示在地图容器中\r\n        window.map = map;//将map变量存储在全局\r\n    }\r\n    \r\n    //地图事件设置函数：\r\n    function setMapEvent(){\r\n        map.enableDragging();//启用地图拖拽事件，默认启用(可不写)\r\n        map.enableScrollWheelZoom();//启用地图滚轮放大缩小\r\n        map.enableDoubleClickZoom();//启用鼠标双击放大，默认启用(可不写)\r\n        map.enableKeyboard();//启用键盘上下左右键移动地图\r\n    }\r\n    \r\n    //地图控件添加函数：\r\n    function addMapControl(){\r\n        //向地图中添加缩放控件\r\n	var ctrl_nav = new BMap.NavigationControl({anchor:BMAP_ANCHOR_TOP_LEFT,type:BMAP_NAVIGATION_CONTROL_LARGE});\r\n	map.addControl(ctrl_nav);\r\n        //向地图中添加缩略图控件\r\n	var ctrl_ove = new BMap.OverviewMapControl({anchor:BMAP_ANCHOR_BOTTOM_RIGHT,isOpen:1});\r\n	map.addControl(ctrl_ove);\r\n        //向地图中添加比例尺控件\r\n	var ctrl_sca = new BMap.ScaleControl({anchor:BMAP_ANCHOR_TOP_LEFT});\r\n	map.addControl(ctrl_sca);\r\n    }\r\n    \r\n    //标注点数组\r\n    var markerArr = [{title:\"东莞市星坤电子有限公司\",content:\"地址：广东省东莞市塘厦镇138工业区宏业北二路3号<br/>TEL:0769-87920467/82611505/33228881<br/>FAX:0769-82611337\",point:\"114.101983|22.826627\",isOpen:0,icon:{w:21,h:21,l:46,t:46,x:1,lb:10}}\r\n		 ];\r\n    //创建marker\r\n    function addMarker(){\r\n        for(var i=0;i<markerArr.length;i++){\r\n            var json = markerArr[i];\r\n            var p0 = json.point.split(\"|\")[0];\r\n            var p1 = json.point.split(\"|\")[1];\r\n            var point = new BMap.Point(p0,p1);\r\n			var iconImg = createIcon(json.icon);\r\n            var marker = new BMap.Marker(point,{icon:iconImg});\r\n			var iw = createInfoWindow(i);\r\n			var label = new BMap.Label(json.title,{\"offset\":new BMap.Size(json.icon.lb-json.icon.x+10,-20)});\r\n			marker.setLabel(label);\r\n            map.addOverlay(marker);\r\n            label.setStyle({\r\n                        borderColor:\"#808080\",\r\n                        color:\"#333\",\r\n                        cursor:\"pointer\"\r\n            });\r\n			\r\n			(function(){\r\n				var index = i;\r\n				var _iw = createInfoWindow(i);\r\n				var _marker = marker;\r\n				_marker.addEventListener(\"click\",function(){\r\n				    this.openInfoWindow(_iw);\r\n			    });\r\n			    _iw.addEventListener(\"open\",function(){\r\n				    _marker.getLabel().hide();\r\n			    })\r\n			    _iw.addEventListener(\"close\",function(){\r\n				    _marker.getLabel().show();\r\n			    })\r\n				label.addEventListener(\"click\",function(){\r\n				    _marker.openInfoWindow(_iw);\r\n			    })\r\n				if(!!json.isOpen){\r\n					label.hide();\r\n					_marker.openInfoWindow(_iw);\r\n				}\r\n			})()\r\n        }\r\n    }\r\n    //创建InfoWindow\r\n    function createInfoWindow(i){\r\n        var json = markerArr[i];\r\n        var iw = new BMap.InfoWindow(\"<b class=\'iw_poi_title\' title=\'\" + json.title + \"\'>\" + json.title + \"</b><div class=\'iw_poi_content\'>\"+json.content+\"</div>\");\r\n        return iw;\r\n    }\r\n    //创建一个Icon\r\n    function createIcon(json){\r\n        var icon = new BMap.Icon(\"http://app.baidu.com/map/images/us_mk_icon.png\", new BMap.Size(json.w,json.h),{imageOffset: new BMap.Size(-json.l,-json.t),infoWindowOffset:new BMap.Size(json.lb+5,1),offset:new BMap.Size(json.x,json.h)})\r\n        return icon;\r\n    }\r\n    \r\n    initMap();//创建和初始化地图\r\n</script><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 20px;\"><span id=\"cke_bm_83S\" style=\"display: none;\">&nbsp;</span><span id=\"cke_bm_85S\" style=\"display: none;\">&nbsp;</span><span id=\"cke_bm_86S\" style=\"display: none;\">&nbsp;</span>如使用百度地图导航系统输入&ldquo;东莞市星坤电子有限公司&rdquo;即可搜索到本司正确路线</span><br />\r\n<div>\r\n	&nbsp;</div>\r\n', '');
INSERT INTO `dede_arctype` VALUES ('58', '5', '5', '8', '研发能力', '{cmspath}/stark/js/yfnl', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/yfnl.htm', 'default/yfnl.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '研发能力|香港星坤工业精密有限公司', '研发能力|香港星坤工业精密有限公司', '研发能力|香港星坤工业精密有限公司', '0', '{cmspath}/stark/js', '', '0', '0', '', '&nbsp;', '');
INSERT INTO `dede_arctype` VALUES ('59', '5', '5', '9', '品保能力', '{cmspath}/stark/js/pbnl', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/pbnl.htm', 'default/pbnl.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '品保能力|香港星坤工业精密有限公司', '品保能力|香港星坤工业精密有限公司', '品保能力|香港星坤工业精密有限公司', '0', '{cmspath}/stark/js', '', '0', '0', '', '&nbsp;', '');
INSERT INTO `dede_arctype` VALUES ('44', '1', '1', '4', '企业文化', '{cmspath}/stark/wh', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/qywh.htm', 'default/qywh.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '企业文化|香港星坤工业精密有限公司', '企业文化|香港星坤工业精密有限公司', '企业文化|香港星坤工业精密有限公司', '0', '{cmspath}/stark', '', '0', '0', '', '<h3>\r\n	<img alt=\"\" src=\"/uploads/allimg/160503/2-160503193S1414.png\" style=\"width: 730px; height: 268px;\" /><br />\r\n	<img src=\"/uploads/allimg/160430/1-160430120H4K6.jpg\" style=\"margin-right: 10px; float: left; width: 240px; height: 188px;\" /></h3>\r\n<div style=\"color: red;\">\r\n	<span style=\"color:#a9a9a9;\"><span style=\"font-size:12px;\">&nbsp;&ldquo;星&rdquo;者，古有万物之精，上为列星的说法；&ldquo;坤&rdquo;者，地也，山岳河渎，皆坤之灵。</span></span></div>\r\n<div style=\"color: red;\">\r\n	<span style=\"color:#a9a9a9;\"><span style=\"font-size:12px;\">星坤借&ldquo;日月星辰，地势大坤&rdquo;之意，生产微小的电子零件，却仍怀鸿鹄之大志</span></span></div>\r\n<div style=\"color: red;\">\r\n	<span style=\"color:#a9a9a9;\"><span style=\"font-size:12px;\">愿&ldquo;星&rdquo;汉灿烂，若出其里；地势大&ldquo;坤&rdquo;，厚德载物，</span></span></div>\r\n<div style=\"color: red;\">\r\n	<span style=\"color:#a9a9a9;\"><span style=\"font-size:12px;\">星坤致力打造中国最电子零组件鳌头企业.商标以蓝色的英文字母&ldquo;STARK&rdquo;代表朗朗<br />\r\n	星空</span>以绿色圆润弧线象征宇宙乾坤。</span></div>\r\n<div style=\"color: red;\">\r\n	<span style=\"color:#a9a9a9;\"><span style=\"font-size:12px;\">商标整体顶天而立地、大气磅礴、气势非凡，是星坤人雄心壮志最好的诠释。</span></span></div>\r\n<div>\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	<span style=\"color:#000000;\"><span style=\"font-size:16px;\"><span style=\"line-height: 20px;\">一、客户至上：</span></span></span></div>\r\n<div>\r\n	<span style=\"color:#000000;\"><span style=\"font-size:16px;\"><span style=\"line-height: 20px;\">客户的信赖和满意，是我们的成就与荣誉。&nbsp;</span><br style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(117, 117, 117); font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; font-size: 18.4px; line-height: 20px;\" />\r\n	<span style=\"line-height: 20px;\">二、全面品管：&nbsp;</span></span></span></div>\r\n<div style=\"text-align: justify;\">\r\n	<span style=\"color:#000000;\"><span style=\"font-size:16px;\"><span style=\"line-height: 20px;\">产品从设计到使用，每一个程序均严格品管使品质完全可靠。&nbsp;</span></span></span></div>\r\n<div>\r\n	<span style=\"color:#000000;\"><span style=\"font-size:16px;\"><span style=\"line-height: 20px;\">三、高标准化：&nbsp;</span><br style=\"margin: 0px; padding: 0px; word-wrap: break-word; color: rgb(117, 117, 117); font-family: \'Microsoft YaHei\', SimHei, Verdana, Arial, sans-serif; font-size: 18.4px; line-height: 20px;\" />\r\n	<span style=\"line-height: 20px;\">无论选材、制造均不断创新和改善，并为追求国际最高标准而努力。</span></span></span></div>\r\n<div>\r\n	&nbsp;</div>\r\n', '');
INSERT INTO `dede_arctype` VALUES ('45', '1', '1', '5', '经营理念', '{cmspath}/stark/ln', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/jyln.htm', 'default/jyln.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '经营理念|香港星坤工业精密有限公司', '经营理念|香港星坤工业精密有限公司', '经营理念|香港星坤工业精密有限公司', '0', '{cmspath}/stark', '', '0', '0', '', '&nbsp;<span style=\"color: rgb(0, 0, 0); font-size: small; line-height: 30px;\">&nbsp; 精益求精，品质制胜，星坤企业在始终在发展中坚持精益求精的精神。在产品设计中，多方面创造和运用先进的技术，具备了高超的多塑模、五金模设计能力，并实现了高速多线冲模。独立开发适用于现代全自动生产需要的产品，从细节入手，强调品质的保障，追求精益求精的精神。</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-size: small; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp; 人性化设计，匹配差异化。星坤企业不仅仅拥有着庞大的生产能力和规模，而且还具有着极为完善的产品服务流水线，能够为当前市场的差异化需求提供人性化的设计。在当前不同领域之中，对电子零部件上的需要千差万别，丰富电子零部件是企业扩大经营和实现跨越式发展的必然。东莞市星坤电子有限公司通过人性化的设计理念，匹配不同市场对产品的不同需求，从而更好的传递出企业强大的市场优势。</span><br />\r\n<strong style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: medium; line-height: 26px;\"><font size=\"3\"><font color=\"#ff3300\">【星坤電子 秉持四大營運宗旨】</font></font></strong><br />\r\n<span style=\"color:#a9a9a9;\"><span style=\"font-size: 14px;\"><span style=\"line-height: 30px;\"><span style=\"background-color:#ffffff;\">&nbsp; &nbsp; &nbsp; &nbsp; 打造全球零组件解决方案提供商，这是星坤企业一直致力于的发展目标&nbsp;</span></span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"line-height: 30px;\"><span style=\"background-color:#ffffff;\">&nbsp; &nbsp; &nbsp; &nbsp; 公司制定&ldquo;不重复错误，追求产品零缺陷，直至客户满意&rdquo;的品质方针&nbsp;</span></span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"line-height: 30px;\"><span style=\"background-color:#ffffff;\">&nbsp; &nbsp; &nbsp; &nbsp; 在合作上实现与客户之间的诚信有礼、互利互惠。&nbsp;</span></span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: 30px;\" />\r\n<span style=\"line-height: 30px;\"><span style=\"background-color:#ffffff;\">&nbsp; &nbsp; &nbsp; &nbsp; 坚信&ldquo;人品即品质&rdquo;，用事实征服大众市场。</span></span><br />\r\n<span style=\"line-height: 26px;\"><span style=\"background-color:#ffffff;\">&nbsp; &nbsp; &nbsp; &nbsp; 我們堅持: 客戶選擇星坤，星坤將儘最大的努力，提供出最好的回饋。</span></span></span></span>', '');
INSERT INTO `dede_arctype` VALUES ('46', '1', '1', '6', '资质荣誉', '{cmspath}/stark/ry', '1', 'index.html', '1', '1', '-1', '1', '0', 'default/ryzz.htm', 'default/ryzz.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '资质荣誉|香港星坤工业精密有限公司', '资质荣誉|香港星坤工业精密有限公司', '资质荣誉|香港星坤工业精密有限公司', '0', '{cmspath}/stark', '', '0', '0', '', '<img alt=\"\" src=\"/uploads/allimg/160430/1-160430120U3F9.jpg\" style=\"width: 710px; height: 598px; float: left;\" /><img alt=\"\" src=\"/uploads/allimg/160430/1-160430120911459.jpg\" style=\"width: 710px; height: 598px; float: left;\" />\r\n<div>\r\n	<img alt=\"\" src=\"/uploads/allimg/160430/1-160430120929622.jpg\" style=\"width: 710px; height: 1307px; float: left;\" /></div>\r\n', '');
INSERT INTO `dede_arctype` VALUES ('47', '3', '1', '4', '招聘信息', '{cmspath}/stark/zp', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/guanyu.htm', 'default/guanyu.htm', '{style}/article_article.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '招聘信息|东莞市星坤电子有限公司', '招聘信息|东莞市星坤电子有限公司', '招聘信息|东莞市星坤电子有限公司', '0', '{cmspath}/stark/new', '', '0', '0', '', '<div class=\"job_c1\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); font-family: \'Microsoft Yahei\', 宋体, Arial, Helvetica, sans-serif; line-height: 24px;\">\r\n	<div class=\"job_c_t\" style=\"padding: 0px; margin: 0px 0px 5px; width: 710px; overflow: hidden;\">\r\n		<div class=\"job_c1\" style=\"padding: 0px; margin: 0px;\">\r\n			<h2 class=\"job_c_t\" style=\"padding: 0px; margin: 0px 0px 5px; width: 710px; overflow: hidden;\">\r\n				我们将最热爱互联网的你提供丰厚的待遇：</h2>\r\n			<br />\r\n			<br />\r\n			<div>\r\n				互联网产品经理（商城运营类产品） &nbsp;</div>\r\n			<div>\r\n				岗位职责</div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">1、完成产品策划和运营工作；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">2、完成需求策划、功能设计，编写产品需求文档、用户文档；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">3、能提出产品体验中的缺陷，进行跟踪并完成产品迭代；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">4、了解用户需求，收集用户反馈，分析用户行为及需求；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">5、负责产品的日常运营。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				任职资格</div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">&bull; 计算机或相关专业；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">&bull; 有做好产品工作的热情与主动性，对待产品工作认真仔细负责；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">&bull; 一年以上互联网工作经验；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">&bull; 熟练使用Word、Excel、Powerpoint等办公软件和截图改图工具；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">&bull; 有较强的抗压能力，有责任感、有上进心；</span></div>\r\n			<div>\r\n				<span style=\"font-size: 10px;\">&bull; 有互联网电商产品经验者优先。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				移动APP视觉设计师 &nbsp; &nbsp;</div>\r\n			<div>\r\n				岗位职责</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">1、负责公司移动APP产品的视觉用户体验设计；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">2、为移动产品开发、交互提供平面技术支持；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">3、能主动对流行趋势分析，主导设定整体视觉风格，有UI设计经验；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">4、能主动分享设计经验、推动提高团队的设计能力。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				天猫、微商运营主管 &nbsp; &nbsp;投递简历</div>\r\n			<div>\r\n				岗位职责</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">1、学习能力强， 熟悉天猫、微店的流程，从事过推广方面的工作；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">2、对推广产品有灵感、有创意，有思路，能够拿出具体有效的推广方案并能付诸行动；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">3、熟练掌握天猫、微店推广营销工具和使用技巧，如直通车、搜索关键词、钻石展位、淘宝客、聚划算、快车等推广手段，有实际操作经验，并对每日数据进行分析调整，达到销售增长目标；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">4、定期针对广告及活动等推广效果跟踪评估，负责统计、分析推广数据及效果，并不断做出优化方案；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">5、开朗、外向，有较强的沟通能力和团队合作精神，具备较好的销售、笔头表达交流的技巧，能适应工作压力和敢于面对挑战。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				任职要求</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&bull;<span style=\"font-size:10px;\"> 要求1年以上天猫商城和微商城的店铺推广经验；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 熟悉天猫和京东的运营环境、交易规则、各类营销工具、站内广告资源；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 有一定的平面设计与审美能力，熟练使用Photoshop和Office</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 能对工作主动、落实和改进；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 及时与同事及合作者沟通，完成规定时间内的任务，把握工作的速度和完成时效；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 具备较强的服务意识和良好的人际沟通、协调能力，能够适应高效率的工作。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				互联网运营、销售经理 &nbsp;</div>\r\n			<div>\r\n				岗位职责</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				1<span style=\"font-size:10px;\">、负责数据产品营销工作，为客户提供个性化的服务，建立长期合作关系；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">2、维护客户关系，完成部门下达的各项业务指标 ；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">3、整合自身资源和公司资源不断挖掘新行业 ；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">4、搜集行业信息，制定行业发展方案，发展行业渠道合作伙伴 。</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">5、价格管控</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				任职资格</div>\r\n			<div>\r\n				&bull;<span style=\"font-size:10px;\"> 了解互联网的特质，熟悉网站运作和推广的各种方式，2年以上数据服务公司售前支持或网站销售经验 ;</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 本科以上学历，计算机、软件等相关专业背景为佳 ；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 熟悉互联网，能独立开发客户 ；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">&bull; 学习能力、沟通能力强，良好的执行力，有积极的工作态度，对工作认真负责。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				自媒体运营经理 &nbsp; &nbsp;投递简历</div>\r\n			<div>\r\n				岗位职责</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">1、负责官方微信、微博、论坛等平台的日常运营管理，内容更新与维护，提升公司品牌，在行业内影响；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">2、通过有效的运营手段增加粉丝数量，增加粉丝粘度，持续提升粉丝的互动性和活跃度；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">3、负责线上互动营销活动的策划、执行；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">4、深入了解互联网，尤其是微信特点及资源，有效运用相关资源；</span></div>\r\n			<div>\r\n				<span style=\"font-size:10px;\">5、负责新媒体推广效果跟踪，分析微博、微信运营数据，撰写运营报告及优化调整工作。</span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				任职要求</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&bull;<spa