><br style=\"padding: 0px; margin: 0px;\" />\r\n			1、负责管理产品渠道销售、维护现有客户关系，发掘客户需求、拓展销售业绩；<br style=\"padding: 0px; margin: 0px;\" />\r\n			2、发掘客户线索、深入了解客户需求、为其提供有价值的方案支持；<br style=\"padding: 0px; margin: 0px;\" />\r\n			3、跟进重要客户关系及订单，积极完成销售任务；<br style=\"padding: 0px; margin: 0px;\" />\r\n			4、收集各种相关市场销售信息、及时反馈客户资源信息、提出有效的销售建议；<br style=\"padding: 0px; margin: 0px;\" />\r\n			5、及时掌握行业发展动向，并提出合理化建设；<br style=\"padding: 0px; margin: 0px;\" />\r\n			6、上级领导交付的其他日常工作。<br style=\"padding: 0px; margin: 0px;\" />\r\n			<br style=\"padding: 0px; margin: 0px;\" />\r\n			<span style=\"padding: 0px; margin: 0px; font-size: 14px;\">任职资格：</span><br style=\"padding: 0px; margin: 0px;\" />\r\n			1、35岁以下，大专以上学历，市场营销专业优先；<br style=\"padding: 0px; margin: 0px;\" />\r\n			2、2年以上销售经验；有IT产品、电子产品、项目相关行业销售经验者优先；<br style=\"padding: 0px; margin: 0px;\" />\r\n			3、熟悉B2B销售模式；<br style=\"padding: 0px; margin: 0px;\" />\r\n			4、具有较强的商务谈判和独立市场开发能力；良好的市场营销策略及销售技巧；<br style=\"padding: 0px; margin: 0px;\" />\r\n			5、良好的沟通交际能力、组织协调能力及团队合作精神；<br style=\"padding: 0px; margin: 0px;\" />\r\n			6、性格外向、有较强的事业心及追求高薪的欲望；<br style=\"padding: 0px; margin: 0px;\" />\r\n			7、工作积极、勤奋、亲和力强。<br />\r\n			<br />\r\n			<div>\r\n				外贸业务员</div>\r\n			<div>\r\n				工作能力：</div>\r\n			<div>\r\n				1、具有较强的沟通能力，责任心强、性格开朗、思路敏捷，语言沟通表达能力强；</div>\r\n			<div>\r\n				2、从事电子开关插座连接器行业销售经验者优先，待遇从优（面议）；</div>\r\n			<div>\r\n				3、从事外贸门店销售经验者优先，待遇从优（面议）；</div>\r\n			<div>\r\n				4、懂得日常英语口语者优先，待遇从优（面议）。</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				工作要求：</div>\r\n			<div>\r\n				1、熟悉操作英文阿里巴巴，中国制造等电子商务平台，熟悉通过B2B平台和搜索引擎开发海外客户；</div>\r\n			<div>\r\n				2、大专或以上学历，熟悉外贸流程，熟练书写外贸信函，具有较强的分析、沟通和谈判能力，有激情；</div>\r\n			<div>\r\n				3、英语四级以上，熟悉OFFICE办公软件；</div>\r\n			<div>\r\n				4、勤奋好学、诚实守信，有良好的职业道德。能承受一定的工作压力、有较强责任心和团队精神。</div>\r\n			<div>\r\n				底薪＋提成</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				如果您符合以上要求，请通过以下方式联系我们，欢迎您的来电咨询！</div>\r\n		</div>\r\n		<div class=\"job_b\" style=\"padding: 30px 0px 0px; margin: 30px 0px 0px; width: 710px; overflow: hidden; border-top-width: 1px; border-top-style: solid; border-top-color: rgb(199, 199, 199);\">\r\n			<p style=\"padding: 0px; margin: 0px;\">\r\n				如果您符合以上要求，请通过以下方式联系我们，欢迎您的来电咨询！</p>\r\n			<br style=\"padding: 0px; margin: 0px;\" />\r\n			<p style=\"padding: 0px; margin: 0px; color: rgb(184, 115, 0);\">\r\n				<strong style=\"padding: 0px; margin: 0px; font-size: 14px;\">人力资源部</strong><br style=\"padding: 0px; margin: 0px;\" />\r\n				联系人：人力资源部<br style=\"padding: 0px; margin: 0px;\" />\r\n				邮 箱：<a href=\"mailto:hyele@smtswitch.com\" style=\"padding: 0px; margin: 0px; text-decoration: none; color: rgb(102, 102, 102); outline: none;\">xk@xk-dg.cn</a></p>\r\n		</div>\r\n	</div>\r\n</div>\r\n<br />\r\n', '');
