INSERT INTO `dede_arctype` VALUES ('72', '67', '67', '1', '关于星坤', '{cmspath}/m/gy', '1', 'index.html', '1', '1', '-1', '1', '0', '{style}/danye_m.htm', '{style}/danye_m.htm', '{style}/danye_m.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', '0', '{cmspath}/m', '', '0', '0', '', '<br />\r\n<br />\r\n<span style=\"margin: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span style=\"margin: 0px; padding: 0px; font-size: 13px; letter-spacing: 3px; text-indent: 25px;\"><span style=\"font-size:16px;\">星坤企业自1995年投资以来，星坤迅速发展目前星坤企业广泛涉足数位内容,手机、MP3、MP4、数位相机、鼠标、键盘、汽车部品、数码音响、家用电器、办公设备、测量仪器、工业控制设备、汽车零组件、云运算，从事的产品有开关，插座，连接器，外设产品，在国内地区，布局生产基地有中国台湾，廣東東莞、廣東惠州、江苏苏州《依照產品分別由以上不同工廠個別生產或發放外包加工》分布的运营销售有中国香港，中国东莞，中国厦门。</span></span></span>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(48, 48, 48); font-family: 微软雅黑; text-align: center;\">\r\n	<span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0);\"><img src=\"http://www.xk-dg.cn/skin/images/xkjjtp.jpg\" style=\"margin: 25px 0px; padding: 0px; border: 0px; color: rgb(72, 72, 72); letter-spacing: 3px; text-indent: 25px; height: 193px; width: 700px;\" /></span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(48, 48, 48); font-family: 微软雅黑;\">\r\n	<span style=\"font-size:16px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0);\"><span style=\"letter-spacing: 3px; text-indent: 25px;\">星坤將朝【國際化】、【專業化】及【多角化】的方向邁進，以宏觀的視野跨步國際、以專業能力領導產品品質、以多元思想面對市場挑戰，並積極提升國際品牌形象，成為您最信賴的伙伴。</span></span></span></div>\r\n', '');
