INSERT INTO `dede_arctype` VALUES ('79', '74', '73', '1', '项目介绍', '{cmspath}/cy/xmjs', '1', 'index.html', '1', '1', '-1', '0', '0', '{style}/index_article.htm', '{style}/list_articlecy.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', '0', '{cmspath}/cy', '', '0', '0', '', '<p style=\"padding: 0px; margin: 0px 0px 10px; text-indent: 2em; line-height: 25.2px; font-size: 14px; text-align: justify; color: rgb(51, 51, 51); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif;\">\r\n	2016年8月星坤企业2016年度支持有梦想的青少年和大学生创业计划正式启动。助力大学生实现人生&ldquo;第一桶金&rdquo;的梦想。</p>\r\n<p style=\"padding: 0px; margin: 0px 0px 10px; text-indent: 2em; line-height: 25.2px; font-size: 14px; text-align: justify; color: rgb(51, 51, 51); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif;\">\r\n	为支持大学生创业，星坤企业于2016年5月31日推出了支持大学生创业计划，在风口上的猪都能飞起来的时代为在过程中帮助大学生创业，星坤企业将采取一系列帮助措施。一是精心挑选并推荐适合大学生创业主要为互联网类和电子制造类，由星坤企业通过专设的创业指导部门进行辅导。</p>\r\n', '');
