INSERT INTO `dede_arctype` VALUES ('82', '75', '73', '1', '申请资格', '{cmspath}/cy/sqzg', '1', 'index.html', '1', '1', '-1', '0', '0', '{style}/index_article.htm', '{style}/list_articlecy1.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', '0', '{cmspath}/cy', '', '0', '0', '', '&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">申请人应当具有强烈的创业意愿，愿意承担创业风险，并同时满足以下全部条件：</span>\r\n<ul class=\"list_ul pl5\" style=\"padding-right: 0px; padding-left: 5px; margin: 0px; list-style: none; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		1、申请人的创业所在地区：限制于广东东莞，广东深圳，广东广州，广东惠州，江苏苏州，福建厦门，福建泉州。</li>\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		2、申请人无不良信用记录。</li>\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		3、申请人20-35周岁。</li>\r\n	<br />\r\n	申请人未同时满足上述条件的，星坤企业有权取消其入选资格。\r\n</ul>\r\n', '');
INSERT INTO `dede_arctype` VALUES ('83', '75', '73', '2', '申请程序', '{cmspath}/cy/sqcx', '1', 'index.html', '1', '1', '-1', '0', '0', '{style}/index_article.htm', '{style}/list_articlecy1.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', '0', '{cmspath}/cy', '', '0', '0', '', '<div class=\"item\" style=\"padding: 10px; margin: 0px; border-radius: 6px; overflow: hidden; zoom: 1; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; background: rgb(249, 249, 249);\">\r\n	<p class=\"num\" style=\"padding: 0px; margin: 0px; font-size: 36px; color: rgb(51, 51, 51); float: left; width: 50px; text-align: center; font-family: Geneva, sans-serif; font-weight: bold;\">\r\n		1</p>\r\n	<p class=\"con\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); float: right; width: 680px;\">\r\n		报名时间：2016年10月1日&mdash;2017年10月1日。</p>\r\n	<p class=\"clearfloat\" style=\"padding: 0px; margin: 0px; height: 0px; font-size: 0px; clear: both; line-height: 0;\">\r\n		&nbsp;</p>\r\n</div>\r\n<p class=\"barrow\" style=\"padding: 10px 0px; margin: 0px; text-align: center; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<img height=\"18\" src=\"http://image.wanda.cn/statics/images/chuangye/ui/barrow.png\" style=\"border: 0px;\" width=\"23\" /></p>\r\n<div class=\"item\" style=\"padding: 10px; margin: 0px; border-radius: 6px; overflow: hidden; zoom: 1; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; background: rgb(249, 249, 249);\">\r\n	<p class=\"num\" style=\"padding: 0px; margin: 0px; font-size: 36px; color: rgb(51, 51, 51); float: left; width: 50px; text-align: center; font-family: Geneva, sans-serif; font-weight: bold;\">\r\n		2</p>\r\n	<p class=\"con\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); float: right; width: 680px;\">\r\n		申请人通过所在星坤官方网站了解星坤企业2016年度支持有梦想的青少年和大学生创业计划有关细则。</p>\r\n	<p class=\"clearfloat\" style=\"padding: 0px; margin: 0px; height: 0px; font-size: 0px; clear: both; line-height: 0;\">\r\n		&nbsp;</p>\r\n</div>\r\n<p class=\"barrow\" style=\"padding: 10px 0px; margin: 0px; text-align: center; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<img height=\"18\" src=\"http://image.wanda.cn/statics/images/chuangye/ui/barrow.png\" style=\"border: 0px;\" width=\"23\" /></p>\r\n<div class=\"item\" style=\"padding: 10px; margin: 0px; border-radius: 6px; overflow: hidden; zoom: 1; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; background: rgb(249, 249, 249);\">\r\n	<p class=\"num\" style=\"padding: 0px; margin: 0px; font-size: 36px; color: rgb(51, 51, 51); float: left; width: 50px; text-align: center; font-family: Geneva, sans-serif; font-weight: bold;\">\r\n		3</p>\r\n	<p class=\"con\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); float: right; width: 680px;\">\r\n		申请人申请创业项目，原则上应以团队方式进行。每个创业团队原则上为2人。团队成员为合伙关系，就创业项目发生的债务共同对外承担连带责任。</p>\r\n	<p class=\"clearfloat\" style=\"padding: 0px; margin: 0px; height: 0px; font-size: 0px; clear: both; line-height: 0;\">\r\n		&nbsp;</p>\r\n</div>\r\n<p class=\"barrow\" style=\"padding: 10px 0px; margin: 0px; text-align: center; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<img height=\"18\" src=\"http://image.wanda.cn/statics/images/chuangye/ui/barrow.png\" style=\"border: 0px;\" width=\"23\" /></p>\r\n<div class=\"item\" style=\"padding: 10px; margin: 0px; border-radius: 6px; overflow: hidden; zoom: 1; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; background: rgb(249, 249, 249);\">\r\n	<p class=\"num\" style=\"padding: 0px; margin: 0px; font-size: 36px; color: rgb(51, 51, 51); float: left; width: 50px; text-align: center; font-family: Geneva, sans-serif; font-weight: bold;\">\r\n		4</p>\r\n	<p class=\"con\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); float: right; width: 680px;\">\r\n		申请人按要求完整填写《星坤青少年和大学生创业计划申请表》，并提交所在高校就业指导部门评审。<br />\r\n		<a class=\"n_dl_rs\" href=\"http://www.xk-dg.cn/zlxz/星坤企业青少年和大学生创业计划表格.doc\" style=\"text-decoration: none; color: rgb(102, 102, 102);\">点击下载</a></p>\r\n	<p class=\"clearfloat\" style=\"padding: 0px; margin: 0px; height: 0px; font-size: 0px; clear: both; line-height: 0;\">\r\n		&nbsp;</p>\r\n</div>\r\n<p class=\"barrow\" style=\"padding: 10px 0px; margin: 0px; text-align: center; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<img height=\"18\" src=\"http://image.wanda.cn/statics/images/chuangye/ui/barrow.png\" style=\"border: 0px;\" width=\"23\" /></p>\r\n<div class=\"item\" style=\"padding: 10px; margin: 0px; border-radius: 6px; overflow: hidden; zoom: 1; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; background: rgb(249, 249, 249);\">\r\n	<p class=\"num\" style=\"padding: 0px; margin: 0px; font-size: 36px; color: rgb(51, 51, 51); float: left; width: 50px; text-align: center; font-family: Geneva, sans-serif; font-weight: bold;\">\r\n		5</p>\r\n	<p class=\"con\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); float: right; width: 680px;\">\r\n		申请人在填写申请表时，必须符合创业项目品类，但也可申报自主创业项目。</p>\r\n	<p class=\"clearfloat\" style=\"padding: 0px; margin: 0px; height: 0px; font-size: 0px; clear: both; line-height: 0;\">\r\n		&nbsp;</p>\r\n</div>\r\n<p class=\"barrow\" style=\"padding: 10px 0px; margin: 0px; text-align: center; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<img height=\"18\" src=\"http://image.wanda.cn/statics/images/chuangye/ui/barrow.png\" style=\"border: 0px;\" width=\"23\" /></p>\r\n<div class=\"item\" style=\"padding: 10px; margin: 0px; border-radius: 6px; overflow: hidden; zoom: 1; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; background: rgb(249, 249, 249);\">\r\n	<p class=\"num\" style=\"padding: 0px; margin: 0px; font-size: 36px; color: rgb(51, 51, 51); float: left; width: 50px; text-align: center; font-family: Geneva, sans-serif; font-weight: bold;\">\r\n		6</p>\r\n	<p class=\"con\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); float: right; width: 680px;\">\r\n		评审通过的申请人名单将由星坤相关人员与您联系或者邮箱通知！</p>\r\n</div>\r\n<br />\r\n', '');
INSERT INTO `dede_arctype` VALUES ('84', '75', '73', '3', '扶持协议', '{cmspath}/cy/fcxy', '1', 'index.html', '1', '1', '-1', '0', '0', '{style}/index_article.htm', '{style}/list_articlecy1.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', '0', '{cmspath}/cy', '', '0', '0', '', '<ul class=\"pt20 list_ul\" style=\"padding-top: 20px; padding-right: 0px; padding-left: 0px; margin: 0px; list-style: none; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		1、候选人应在规定时间内与星坤企业签订统一格式的创业扶持协议，明确各方权利义务。若候选人未按期签约的，星坤企业有权取消候选人资格。</li>\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		2、候选人签订创业扶持协议后，应严格按协议约定执行创业计划，履行协议约定的各项义务。如候选人逾期不执行创业计划，或有其他违约情形，星坤企业有权取消候选人资格，并按创业扶持协议相关约定处理。</li>\r\n</ul>\r\n<div class=\"mt30\" style=\"padding: 0px; margin: 30px 0px 0px; font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px; color: rgb(255, 0, 0);\">\r\n	其他</div>\r\n<ul class=\"list_ul\" style=\"padding-right: 0px; padding-left: 0px; margin: 0px; list-style: none; color: rgb(0, 0, 0); font-family: 微软雅黑, Tahoma, Verdana, STHeiTi, simsun, sans-serif; font-size: 14px;\">\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		1、候选人创业自负盈亏。</li>\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		2、本报名细则的解释权归星坤所有。</li>\r\n	<li style=\"padding: 0px 0px 0px 25px; margin: 15px 0px 0px; height: auto; line-height: 22px; overflow: hidden; color: rgb(51, 51, 51); background: url(http://image.wanda.cn/statics/images/chuangye/add/bg/li_bg.png) 0% 0% no-repeat;\">\r\n		3、星坤企业保留对本报名细则进行更改的权利。</li>\r\n	<li>\r\n		&nbsp;</li>\r\n</ul>\r\n', '');
