INSERT INTO `dede_arctype` VALUES ('88', '67', '67', '4', '联系我们', '{cmspath}/m/lxwm', '1', 'index.html', '1', '1', '-1', '1', '0', '{style}/danye_m.htm', '{style}/danye_m.htm', '{style}/danye_m.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', '0', '{cmspath}/m', '', '0', '0', '', '&nbsp;\r\n<h5 style=\"margin: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(0, 116, 192); font-size: 13px;\">\r\n	我们以提供每一位客户，优良的品质与最好的服务为宗旨。 如果对于我们的公司、产品或服务想要获得更进一步的讯息，请不要犹豫与我们联系，我们会尽快回应你！<br style=\"margin: 0px; padding: 0px;\" />\r\n	400-888-7082</h5>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"3\" style=\"margin: 0px; padding: 0px; color: rgb(48, 48, 48); font-family: 微软雅黑;width: 700px\">\r\n	<tbody style=\"margin: 0px; padding: 0px;\">\r\n		<tr style=\"margin: 0px; padding: 0px;\">\r\n			<td style=\"margin: 0px; padding: 0px;\">\r\n				<h5 style=\"margin: 0px; padding: 0px; color: rgb(0, 116, 192); font-size: 13px;\">\r\n					香港公司：（投資、管理、香港區業務窗口）<br style=\"margin: 0px; padding: 0px;\" />\r\n					香港星坤工业精密有限公司</h5>\r\n				<span style=\"font-size:12px;\"><a style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); line-height: 25px; text-indent: 25px;\">地址：香港九龍尖沙咀柯士甸道122號麗斯中心12樓A1座<br style=\"margin: 0px; padding: 0px;\" />\r\n				电话:400-888-7082<br style=\"margin: 0px; padding: 0px;\" />\r\n				E-mail:xk@xk-dg.cn</a></span></td>\r\n			<td style=\"margin: 0px; padding: 0px;\">\r\n				<img src=\"http://www.xk-dg.cn/skin/images/lxwm1.jpg\" style=\"margin: 0px; padding: 0px; border: none;\" /></td>\r\n		</tr>\r\n		<tr style=\"margin: 0px; padding: 0px;\">\r\n			<td style=\"margin: 0px; padding: 0px;\">\r\n				<h5 style=\"margin: 0px; padding: 0px; color: rgb(0, 116, 192); font-size: 13px;\">\r\n					厦门公司：（營銷、物流进出口配送中心）<br style=\"margin: 0px; padding: 0px;\" />\r\n					厦门市星匡电子科技有限公司</h5>\r\n				<span style=\"font-size:12px;\"><a style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); line-height: 25px; text-indent: 25px;\">地址:福建省厦门市湖里区吕岭路彩虹花园179之1号702室<br style=\"margin: 0px; padding: 0px;\" />\r\n				电话: +86-0592-5230700<br style=\"margin: 0px; padding: 0px;\" />\r\n				E-mail:xkkj@xk-dg.cn<br style=\"margin: 0px; padding: 0px;\" />\r\n				诚信通商铺：</a><a href=\"https://xkbswitch.1688.com/\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; line-height: 25px; text-indent: 25px;\">https://xkbswitch.1688.com</a></span></td>\r\n			<td style=\"margin: 0px; padding: 0px;\">\r\n				<img src=\"http://www.xk-dg.cn/skin/images/lxwm3.jpg\" style=\"margin: 0px; padding: 0px; border: none;\" /></td>\r\n		</tr>\r\n		<tr style=\"margin: 0px; padding: 0px;\">\r\n			<td style=\"margin: 0px; padding: 0px;\">\r\n				<h5 style=\"margin: 0px; padding: 0px; color: rgb(0, 116, 192); font-size: 13px;\">\r\n					东莞工厂（營銷、設計、制造）<br style=\"margin: 0px; padding: 0px;\" />\r\n					東莞市星坤電子有限公司</h5>\r\n				<span style=\"font-size:12px;\"><a style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); line-height: 25px; text-indent: 25px;\">地址:广东省东莞市塘厦镇138工业区宏业北二路3号<br style=\"margin: 0px; padding: 0px;\" />\r\n				电话: +86-0769-87920467 82611505 33228881<br style=\"margin: 0px; padding: 0px;\" />\r\n				传真: +86-0769-82611337<br style=\"margin: 0px; padding: 0px;\" />\r\n				E-mail:xk@xk-dg.cn&nbsp;<br style=\"margin: 0px; padding: 0px;\" />\r\n				诚信通商铺：</a><a href=\"https://xkkhk.1688.com/\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; line-height: 25px; text-indent: 25px;\">https://xkkhk.1688.com</a></span></td>\r\n			<td style=\"margin: 0px; padding: 0px;\">\r\n				<img src=\"http://www.xk-dg.cn/skin/images/lxwm2.jpg\" style=\"margin: 0px; padding: 0px; border: none;\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(48, 48, 48); font-family: 微软雅黑;\" />\r\n<h5 style=\"margin: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(0, 116, 192); font-size: 13px;\">\r\n	Hours: Monday to Saturday AM 08:00-12:00 PM 13:30-17:3