INSERT INTO `hcd_product` VALUES ('2622', '11', '81', '0', '轻触开关按不动是哪里的问题', '轻触开关', '/uploads/allimg/16/3-161103224ZA53-lp.jpg', '1478184505', '1478184560', '0', '轻触开关顾名思义就是更加方便，按起来也很省力好操作的开关，不过在生活中有朋友虽然安上了轻触开关，却按不动，有时候很费劲，那么这到底是怎么一回事呢？今天我们就来为大', '1', '2621');
