INSERT INTO `hcd_product` VALUES ('2919', '11', '232', '0', '轻触开关电流原理', '刘杨', '/uploads/allimg/16/1-16120PR500496-lp.gif', '1481156895', '1481156760', '0', '轻触按键开关是一种自身带线路的按键，通常最上层是由PET或PC等等材料组成的有文字或图案的面板，下层是可导电的线路，中间一层是模拟开关形式并起隔离作用的由PET材料作成的双面', '1', '2893');
