INSERT INTO `hcd_product` VALUES ('4090', '11', '70', '0', '轻触开关三种材质材料', '刘杨', '/uploads/allimg/17/1_012016024bC5.jpg', '1484899287', '1484899369', '0', '轻触开关有三种材质：铜弹片此款材料偏软，用在轻触开关上面寿命较低，正常只有3-5W次寿命是市面上面最多厂家选择使用的，质量稳定价格适中不锈钢弹片此款材料需要不锈钢镀银，', '1', '2422');
