INSERT INTO `hcd_product` VALUES ('4199', '11', '79', '0', '轻触开关四个引脚是什么意思', '刘杨', '/uploads/allimg/17/1_02161J24W200.jpg', '1487238084', '1487238168', '0', '1.使用四脚轻触开关的时候，以满足操作力条件，向开关进行施压，以此来进行开启、关闭的功能。 2.当撤销施压的时候，四脚轻触开关就会被关闭，其四脚轻触开关内部结构都是依靠', '1', '2531');
INSERT INTO `hcd_product` VALUES ('4200', '11', '119', '0', '拨动开关的种类', '刘杨', '/uploads/allimg/17/1-1F21Q0064a44-lp.jpg', '1487383494', '1487383634', '0', '拨动开关又名滑动开关，英文名slide switch 拨动开关的品种有单极双位、单极三位、双极双位以及双极三位等，它一般用于低压电路。 此款开关的种类有分为： 1，横柄拨动开关 2，直柄', '1', '2532');
INSERT INTO `hcd_product` VALUES ('4201', '11', '123', '0', '拨动开关生产厂家', '刘杨', '/uploads/allimg/17/1_02211KJTM8.jpg', '1487670871', '1487671068', '0', '拨动开关又名滑动开关，最早也是出现在日本，感觉很多生活中随处可见的产品都是日本人先弄出来的。该款开关是指通过拨动柄的，滑动来控制线路的通断，从而达到切换线路的功能', '1', '2533');
INSERT INTO `hcd_product` VALUES ('4202', '11', '206', '0', '拨动开关的接通原理', '刘杨', '/uploads/allimg/17/1-1F223142629212-lp.jpg', '1487831118', '1487831221', '0', '拨动开关的接通原理分析： 拨动开关是通过拨动开关柄来带动滑块或滑片的滑动，从而控制开关触的接通与断开。 拨动开关分为单极双位和双极双位两种结构形式，主要用于电源电路的', '1', '2534');
INSERT INTO `hcd_product` VALUES ('4203', '11', '198', '0', '如何挑选轻触开关及其寿命测试方法', '刘杨', '/uploads/allimg/17/1_02241P0404053.jpg', '1487930353', '1487930440', '0', '轻触开关的挑选 识别轻触开关的好坏，关键在于考究轻触开关的防护性、可焊性、导通可靠性、寿命、手感、生产工艺和安装尺寸等方面因素决定 。以下品赞电子就如何挑选轻触开关', '1', '2535');
