INSERT INTO `hcd_product` VALUES ('4206', '11', '81', '0', '检测开关滚动开关拨动开关拨码开关的主要介绍', '刘杨', '/uploads/allimg/17/4-1F3021R91O43-lp.jpg', '1488450643', '1488450600', '0', '检测开关 检测开关与许多其它开关技术相比，在本质上更小和更灵活。检测开关适用于多种安装和致动配置，提供更大的灵活性和能力来针对具体应用需求配置开关。 典型的检测开关能', '4', '2445');
INSERT INTO `hcd_product` VALUES ('4207', '11', '77', '0', '贴片轻触开关对精密程度要求很高', '刘杨', '/uploads/allimg/17/4-1F304092Rac-lp.jpg', '1488590796', '1488590919', '0', '我们从下面几个方面进行对比 贴片轻触开关主要有：冲压--注塑--清洗--装配--成型--检验等工序；而薄膜开关的工艺主要为：丝印--模切--装配--检测等工艺。二者对生产环境的要求都很高', '4', '2446');
