INSERT INTO `hcd_test` VALUES ('4003', '17', '', '0', '', '183.23.255.177', '', '按键开关可为您构建操作感可靠舒适的长行程式和机械地保持操作状态的锁定机制。产品用途广泛，包括从AV设备到地图灯等各种车用产品。星坤产品覆盖了从微小电流到中等电流的广泛领域。产品种类多样，有垂直，水平，等操作方向，还能支持各种电路数，接点结构，尺寸等。', '320', '336', '', '', '337', '322', '', '318', '341', '330', '332', '', '', '', '', '', '', '', '', '', '', '');
